import { createTheme } from "@material-ui/core";
import { makeStyles } from '@mui/styles';
import { withStyles } from "@material-ui/core/styles";


export const darkTheme = createTheme({
    palette: {
        mode: 'dark',
        primary: {
            main: '#082032'
        },
        secondary: {
            main: '#FF4C29'
        },
        
        background: {
            default: '#2C394B',
            paper: '#2C394B',
            card: '#2C394B'
          }, 
    },
    body: '#2C394B'
});

export const lightTheme = createTheme({
    palette: {
        primary: {
        main: '#FEA82F'
        },
        secondary: {
        main: '#FF6701'
        }
    }  
});

const styles = theme => ({
    root: {
      backgroundColor: "red"
    }
  });
